import React from 'react';
import logo from '../../assets/images/LOGO2.png';
import  './Footer.css'; 

const Footer = () => {
  return (
    <footer className="home-footer">
      <img src={logo} alt="Kasa logo footer" className="footer-logo" />
     
    </footer>
  );
};

export default Footer;
